(()=>{const e=document.getElementById("search");document.getElementById("submitSearch").addEventListener("click",(async function(){try{const t=e.value,o=await fetch(`https://api.openweathermap.org/data/2.5/weather?q=${t}&appid=d5593e4a1e2f16160e3c632f71177701&units=metric`,{mode:"cors"}),n=await o.json(),a={temp:Math.round(n.main.temp),clouds:n.clouds.all,humidity:n.main.humidity,wind:n.wind.speed};console.log(n),console.log(`${t} is currently:`,a.temp),console.log(a),console.log(Math.floor((new Date).getTime()/1e3))}catch(e){console.log("error in fetching weather data",e)}}))})();